// TravelHistory.js
import React from 'react';
import './TravelHistory.css';

const TravelHistory = () => {
  const travelData = [
    { id: 1, destination: 'Paris', date: '2024-05-20', details: 'Visited Eiffel Tower' },
    { id: 2, destination: 'New York', date: '2023-08-15', details: 'Attended Broadway Show' },
    // Add more mock travel data as needed
  ];

  return (
    <div className="travel-history-page">
      <h2>Travel History</h2>
      <ul className="travel-list">
        {travelData.map((trip) => (
          <li key={trip.id} className="travel-item">
            <h3>{trip.destination}</h3>
            <p>Date: {trip.date}</p>
            <p>Details: {trip.details}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TravelHistory;
